import React from 'react';

const NominatorDashboard = ({ allUsers, allNominees }) => {
  return (
    <>
      <header>
        <div className="navbar navbar-dark bg-dark box-shadow">
          <div className="container d-flex justify-content-between">
            <a href="#" className="navbar-brand d-flex align-items-center">
              {allUsers.map(user => {
                if (user.id === session['uuid']) {
                  return <strong key={user.id}>Welcome: {user.full_name}</strong>;
                }
              })}
            </a>
          </div>
        </div>
      </header>

      <main role="main">
        <div className="album py-5 bg-light">
          <div className="container">
            <div className="row">
              <div className="d-flex align-items-center justify-content-between mx-5">
                <div></div>
              </div>
            </div>
            <div>
              <a className="text-success" href="/nominee/new">+ New Nominee Form </a>
            </div>
            <div className="col-md-4">
              <a className="text-warning" href="/dashboard">Back |</a>
              <a className="text-danger" href="/user/logout"> Logout </a>
            </div>

            <div className="row">
              <table className="table">
                <thead>
                  <tr>
                    <th>Nominee Name</th>
                    <th>Nominator</th>
                    <th>Actions</th>
                  </tr>
                </thead>
                <tbody>
                  {allNominees.map(nominee => {
                    if (nominee.nominator.id === session['uuid']) {
                      return (
                        <tr key={nominee.id}>
                          <td>{nominee.full_name}</td>
                          <td>{nominee.nominator.full_name}</td>
                          <td>
                            <a href={`/nominee/${nominee.id}/edit`}>Edit</a>
                            <a className="text-danger" href={`/nominee/${nominee.id}/delete`}>Delete</a>
                            <a href={`/nominee/${nominee.id}/info`}>View</a>
                          </td>
                        </tr>
                      );
                    }
                  })}
                </tbody>
              </table>
            </div>
          </div>
        </div>
      </main>
    </>
  );
};

export default NominatorDashboard;
